package operator;

public class Logical {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		
		int num = 10;
		int num2 = 100;

		System.out.println(num > 5 && num2 > 5);
		System.out.println(num > 5 && num2 > 1000);
		System.out.println(num > 5 || num2 > 1000);
		System.out.println(num > 100 || num2 > 1000);
		

	}

}
